import React from "react";


function Home() {
  return (
    <div className="home">
      <div class="container">
        <div class="row align-items-center my-5">

          <div class="col-lg-5">
            <h1 class="font-weight-light">Home page</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
